public class StrStr {
	public static void main(String[] args) {
		System.out.println(strStr("abcdefg","cde"));
	}

    public static int strStr(String haystack, String needle) {
        if (needle==null || needle.length()==0 || haystack==null ||haystack.length()==0) return -1;
		if (needle.length()>haystack.length()) return -1;
		
		long needleHash = 0;
		for ( int i = 0 ; i < needle.length() ; i++) {
			needleHash = 29*needleHash + ((long)needle.charAt(i));
		}
		
		long haystackHash = 0;
		for (int i = 0 ; i < needle.length() ; i++) {
			haystackHash = 29*haystackHash + ((long)haystack.charAt(i));
		}
		
		if (haystackHash==needleHash) return 0;
		
		for (int i = needle.length(); i < haystack.length() ; i++) {
			haystackHash -= ((haystack.charAt(i-needle.length()))*Math.pow(29,needle.length()-1));
			haystackHash = 29*haystackHash + ((long)haystack.charAt(i));
			if (haystackHash==needleHash) {
				//System.out.println(i);
				return i-needle.length()+1;
			}
			//System.out.println(haystackHash+" "+needleHash);
		}
		return -1;
    }
}
